import React from 'react'

export default function CheckBox({pbTableDisplay,productsBrands,nameCheckBox,onChangeCheckBox}) {
    return (
    <div className={pbTableDisplay ? "productTableDisplay" : "productTableDisplayNone" }>
        {productsBrands
                .map((brandInContext,index) => <div key={index}><input type="checkbox" name={nameCheckBox} value={brandInContext} onChange={() => onChangeCheckBox(index)} /><label>{brandInContext}</label></div>)
            }
    </div>
    )
}
